import React from 'react';
import { Link } from 'react-router-dom';
import '../sstyles/Home.css'; // Make sure to create and import this CSS file for styling

const Home = () => {
  return (
    <div className="home-container">
      <h1 className="title">Fruit.AI</h1>
      <p className="tagline">"Be Healthy!"</p>

      <div className="grid-container">
        <Link to="/chatbot" className="grid-item chat">Chat.</Link>
        <Link to="/translator" className="grid-item translator">G<sub>x</sub></Link>
        <Link to="/faq" className="grid-item faq">FAQs</Link>
        <Link to="/about" className="grid-item about">About</Link>
      </div>
    </div>
  );
};

export default Home;
